import React from 'react'

export default function Chart(props) {
    const { data } = props;
    const dataArr = [...data]

    const grid = () => {
        return dataArr[0].map((el, i)=>'1fr')
    }

    return (
        <div className='chartContainer' style={{ gridTemplateRows: grid()}}>Chart</div>
    )
}
